        "description": "You've only been at Black Rock City for a few days now and you've already violated several if not all of the 10 Principles.  Did you fail to chase down that moop headed to the trash fence?  Maybe you're all inclusive except for shirtcockers?  You probably can't name more than 3 of the 10 Principles.  If so, The Disciples of the Dust will be operating a confessional for those who have violated  the 10 Principles.  Confess your transgressions, accept your penance and receive absolution.  You can trust the Disciples...... we're trained professionals!    \r\nWe believe Larry will stop by and give us his blessing.  Have your picture taken with Larry or our facsimile of Larry descending the mount with the 10 Principles Tablet.",
