        "description": "This workshop is about working with the magical, creative energy of Burning Man to create a plan-of-action to bring your unique offering to the world.  When you are holding onto your creative expression, your gifts, your particular genius, or pretending not to know what it is, it's gets very uncomfortable after a while. It will start itching inside of you to be created in physical form, it's deepest desire is to be born out of the dream space. You came to Planet Earth to share this, now is your time. Calling all healers, conversation-starters, rebels, light-workers, and medicine women. This workshop is broken down into four magical sections. \r\n\r\n1) Connection. How relating to others is the number one function of your business or passion project. We begin the workshop with getting connected on the soul level to your fellow sisters.\r\n2) Reclaiming Your Unique Brilliance. Refining your message and creating something in the world that is unique, contributive, and that people will pay for. \r\n3) Healing Your Relationship With Money. Girl, if you want to start or expand your business, you've got to look at your drama and trauma with money. What would it be like if money flowed to you with ease? What would it be like if you could actually receive it? We will dive into this exploration together.\r\n4) Closing Ritual. Our closing ritual will include a beautiful ceremony to hold each others intentions and desires as we go create in the world. You will be let into a \"light-share\" experience.",
