        "description": "Join us Friday for an annual event with details to come. Celebrating our growing presence at Black Rock City and the unique and special dynamic of the LGBTQ++ presence. Honoring the Gayborhood and it history.\r\n\r\nBe sure and read http://queerburners.com/news/burner-history-x when you can. There will be new information added to it through the year as already so many accomplishments have been made.\r\n\r\nQueer Burner History and Burning Man History are very telling in the development of our vie of the 10 Principles and how we have brought them into our lives.\r\n\r\nWe are celebrating the special flavor lgbtq burners have brought to Burning Man and our refusal to be simply integrated by radically express our specialness and invite everyone to join us on the journey; and let's invite everyone to join us in the celebration, too!\r\n\r\nMore details to come!!!!! Join the BRC Gay Pride Parade Facebook group and share in the discussion!",
