        "description": "Build up your eco-consciousness for Playa life. We’ll show you how we reuse, recycle, repurpose, and redesign. See our solar cooker, rocket stove cooker, solar power, evapotron, and much more. Consider the Playa’s ecosystem, and the gear and food that are right for a trip into this world.Be ready for your next vacation with Mother Nature.\tNothing seems more natural than spending time in nature, but it’s easy to forget eco-attitudes when away from concrete cities.\r\n     We’ll discuss prepping for a trip, being alert to pack only what we need: e.g., first aid kit, weather-appropriate clothing/gear, water & food. We leave packaging at home to minimize trash on-Playa. If we can, we pre-buy local fruit, veggies, and nuts; pre-make dishes and seal them in lightweight reusable containers. Reuse these to avoid disposables. We seal our food well, store trash, compost and recycle our waste.\r\nWe’ll be happy to hear your own ideas and consider them for additions to our Playa eco-practices.",
