        "description": "Continuing the tradition of early week day partying, Asparagus Forest will be hosting a day of games and food. These festivities will be timed to start as other camps finish their setup, providing a great way for people to meet their neighbors while relaxing from the hard labor of setup.\r\n\r\nMusic will consist of a variety of things that are not EDM, such as classic and alternative rock. Beer Pong is a possibility if our moop management plans pan out. Food will include your backyard staples- hotdogs, lamb skewers, corn on the cob, and various other items.\r\n\r\nThe bar will, of course, be open. We plan to have a keg to serve inexpensive beer (and also cut down on MOOP from cans.)\r\n\r\nGames Include:\r\n\r\nCornhole/Bag Toss\r\nLadder Golf\r\nHorseshoes\r\nDarts\r\nAsparagus Jousting\r\nCanjam",
