        "description": "Jamrunner is a \"Journey to the End of the Night\" styled game (ie: zombie tag, spy tag). \r\n\r\nBetween evading pursuers, there is an interactive story that will unfold the longer a player remains in the game. The more resources I have available to me, the more enriched I can make this experience. I will need LOTS of printed materials, including maps and dossiers.\r\n\r\nIf you'd like to join (or know a person/camp who can help) let me know! See below for details.\r\n\r\nThe story:\r\nBusinessman and Nevada oligarch, Randall \"Buck\" Thurlough, is about to deal a deathblow to decommodification at Burning Man. The Order of Greywater Cockatoos is waging a subversive campaign against this corporate takeover. You are a member of this underground movement led by the elusive culture jammer, Darwin Sandiego.\r\n\r\nBe careful! Thurlough's influence has grown to the point that he has successfully installed his own hired muscle at the festival. Private contractors of the notorious Pike River Security Firm roam the playa. If they catch you, they'll coerce you into turning on your fellow operatives.",
