        "description": "The Back Alley Cinema (located appropriately enough behind the Black Rock City Self Service Abortion Clinic) has been providing literally dozens of burners with nightly entertainment, intermittently, since 2009.  Now a part of the Cult of the Magic Lady!\r\n\r\nCome plop yourself down on a couch... or on a fellow burner... or on a fellow burner ON a couch..  Enjoy fresh popped corn in the middle of nowhere.  Programming varies but, with a library of terabytes of entertainment onhand, is bound to be... entertaining to someone.  Bring a friend!  Or two!  Maybe even three, but let's not overdo it, we usually don't have THAT much room.\r\n\r\nEveryone has to grow tired of nonstop raving now and again (I think... Do you?  Honestly, I wouldn't know... Never really was my thing...  Which is why I run a theater... in a desert..  Oh crap, I think I may have gotten off track...) so take a night off and JOIN US...\r\n\r\nFree intoxicants for the kids!  (No, not really... I'm actually just amazed at how many characters I'm allowed to type in this section...  Really.  I've only just passed the halfway point.  Isn't that nuts?  How are you to be expected to come up with so much to say, really...?)\r\n\r\nPrevious nights have included: Dude Night (Tron, The Fisher King, The Big Lebowski), Musical Night (Repo: The Musical, Tommy, Suck)... Some nights we don't even HAVE themes!  (Because, you know... Burning Man...  Plans vaporize!)\r\n\r\nSo be sure to visit us at some point in your travels.  You can also get yourself loaded at the Koi Lounge, and of course HAVE AN ABORTION... Or two... Or three! (You slut, but we don't do shame because.... What's the point?)",
        "title": "Nightly \"Celluloid\" Debauchery - Back Alley Cinema",
        "url": "",
        "year": {
            "id": 11,
            "year": "2015"
        },
        "all_day": false,
        "id": 14708,
        "print_description": "\"Live people ignore the strange and unusual...\"  Why be like them?\r\nNightly double/triple features of cult/oddities/what-have-you... POPCORN!",
