        "description": "This workshop will explore how open relationships can be way to transform the opposition between Freedom and Love into the mutual support of Love and Truth. \r\n\r\nMany people in relationships struggle to reconcile their Love for each other and desire for deep partnership with their desire for the Freedom to connect intimately with others. The default model for relationship in our society, monogamy, makes explicit the underlying belief that Freedom and Love exist in opposition with each other.\r\n\r\nBut what if our desire for Freedom in relationship is covering a deeper desire, namely that we want to know, and be assured, that we can speak and honor our deepest Truths, and Desires, even, and especially, while in we are in Loving committed partnerships. So what if, instead of talking about Freedom, we talked how to create a relationship where it's safe to speak our Truths, including all of our desires (even for others), and know that we will still be Loved?\r\n\r\nJoin us for a conversation about how open relationships can be created from a place deep Love and commitment to Truth.",
