        "description": "An innovative blend of Hathaway Yoga, Temple Fusion Belly Dance & Ritual through the art of women's vitality practices using yogic principles.\r\n\r\nRITUAL MOVEMENT ARTS (R.M.A) With Aradia Sunseri\r\nAn innovative blend of Hatha Yoga, Temple Fusion Belly Dance & Ritual Theatre. \r\n\r\nWe will explore the art of women’s vitality practices \r\nfocused on:\r\n~Creating, cultivating & nurturing your personal practice: \r\n~Inner yoga’s \r\n~ Temple Fusion Belly dance\r\n~Breathe work\r\n~Meditation\r\n~Mudras\r\n~Isolations, drills,Layering\r\n~Theatrical presence, flourishes\r\n\r\nFocusing on dancing from the core. Opening the body with yogic principles to deepen your connection to your dance. With presence fluidity and slinky theatrical moves. Exploring intricate mudras, and choreography while activating the creative soul seat of each individual’s personal transformative power. Tune in with your inner archetypal energy and the art of storytelling through the eyes, hips, & heart. These vitality practices offer connection to ones own essence and cultivate enjoyment of the body in motion while sharing in a community of sisterhood.",
