        "description": "LIke most carnival games, the risk is part of the fun.. This is a game with a simple premise; Draw a card from the deck and the player does what is written.  Is it ever really simple?  “The Game” requires a high degree of interactivity among all those involved, even those walking by may become drawn into the action and be participants. “The Game” has a tendency to create possibilities where there were once boundaries.  Choices where there were once obstacles.  “The Game”: the love child of truth or dare, charades, post office, twister, spin the bottle, and American's Got talent.. \r\n“The Game” is perfect for letting that INNER freak come out. Watch what happens when permission is given to the darker, more playful side of one's self. That part that stays just out of sight, watching from the sideline, wanting to take part, but doesn't due to social constraint or peer reprisal.\r\n“The Game” is both a game of chance and boundaries.  Winning is all a matter of perspective. Everyone wins with the upside of personal insight, everyone loses what may have been a self-limiting perspective.  A new episode with each draw is guaranteed to amaze and astound!",
